import MainPage from '../main-page/main-page';
import {booksPropTypes} from '../../common/prop-types.js';
import {AppRoute} from '../../common/const';
import {Routes, Route, Router as BrowserRouter} from 'react-router-dom';
import NotFoundScreen from '../not-found-screen/not-found-screen';
import SignIn from '../SignIn/SignIn';
import BookPage from '../book-page/book-page';

 const App = (props) => {
     const {booksData} = props;

     return  (
      <BrowserRouter>
        <Switch>
            <Route path={AppRoute.MAIN} exact>
              <MainPage books={booksData} />
            </Route>
            <Route path={AppRoute.LOGIN} exact>
              <SignIn />
            </Route>
            <Route path={AppRoute.BOOK} exact
              render={(routeProps) => {
                const bookId = +routeProps.match.params.id;
                return <BookPage bookId={bookId} />
              }}
            >       
            </Route>
            <Route exact path={AppRoute.ERROR}
              render={() => <NotFoundScreen />}
            >
            </Route>
        </Switch>
      </BrowserRouter>   

     );
 };

 App.propTypes = {
	booksData: booksPropTypes
};

 export default App;
